import React from 'react';
// import './Pages/mainInfo.css';


const MainInfo = () => {
    return(
        <section className="mainInfo__main">
            <div className="mainInfo__container">
                <div className="mainInfo__wrapper">
                    <p className="mainInfo__detail">MainPage Info</p>
                </div>
            </div>
        </section>
    )
}

export default MainInfo;
